INSERT INTO `learning_material_parts` (`part_id`, `material_id`, `part`, `material_content`) VALUES
(120, 17, 1, '<p style=\"margin-left:0px;\"><span style=\"background-color:transparent;\"><strong>Teens and Entertainment</strong></span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">By Vivien Tan</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">All people need entertainment. Old people need entertainment. Young people need entertainment too. Everybody has his or her own choice of entertainment.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">Surely, teens need entertainment. There are some popular choices of entertainment among teens. Some teens play online games for entertainment. They play Mobile Legend. Besides, teens listen to songs. They love Korean songs. Some watch movies. They love to watch movies. Some teens love Hollywood movies. However, many of them love Bollywood movies.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">I think, one choice of entertainment that most teens love is to watch YouTube. They watch many YouTube videos. YouTube has millions of videos. They get entertainment. They are happy. Moreover, they have fun. They watch Korean dramas in YouTube. Besides, teens also watch box-office music videos. They sing along. Furthermore, they dance too.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">It is important for teens to have entertainment. Teens are students. It is not easy to be students. Students have many challenges. Moreover, they are stressful. Entertainment makes teens happy. In addition, they feel good. They smile. With entertainment, teens feel relaxed. They also feel great.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">In conclusion, entertainment is important for teens. Entertainment is important for other people too.</span></p>'),
(121, 17, 2, '<p style=\"margin-left:0px;\"><span style=\"background-color:transparent;\"><strong>Anger Management</strong></span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">By Alissa Mastura</span></p><p style=\"margin-left:0px;\"><br>&nbsp;</p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">Angry, angry, angry. Nobody is perfect. Everybody gets angry. Sometimes, our friend is angry. Sometimes, our teachers are angry. Most of the time, our parents are angry with us.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">Why do people get angry? Are they crazy? No. People get angry because of different reasons. Maybe, a mother is angry because she is tired. Mother cooks food, washes toilet, sweeps the floor and does many other chores. Sometimes, a child is angry because she or he has to do many house chores to help mother. In school, teachers are angry, maybe because the pupils do not do their homework. Moreover, pupils also make a lot of noise. Moreover, the class is also very dirty.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">I think when we are angry, we can do a few things. First, we must keep quiet. Do not say anything. We must relax and take a deep breath. This can help us to relax. Moreover, we can do yoga too. When we do yoga, we feel good. Besides, we feel great. We can control our anger better. Muslims can pray when they are angry. In addition, they can read Quran.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">We must know how to control our anger. First, when we can control our anger, we do things correctly. We will not make mistakes. Next, when we control our anger, we control our blood pressure. Furthermore, we also control our stress level.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">In conclusion, it is good that we learn how to control our anger. There are many effective and practical ways to control our anger. We choose what we like.</span></p>'),
(122, 17, 3, '<p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">True Friendship</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">By Fatimah Hamzah</span></p><p style=\"margin-left:0px;\"><br>&nbsp;</p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">Rosmah, Halimah, Salmah, Normah and Shimah are my friends. I am Fatimah. I am the leader of “Mah Group”. I love my friends. They love me too. They are my true friends.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">In my opinion, a true friend is kind. A true friend always helps us when we need help. Moreover, a true friend is loving. He or she loves us even though we are not smart or poor. I believe a true friend must also be supportive. He or she always supports us when we have problems. Furthermore, a true friend should always support us to do our best and not to give up easily.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">We can maintain our friendship in many ways. For example, we must always respect our friends. Then, if we make a mistake, we must quickly say sorry. It is fine to say sorry. If we can, we should buy a gift on our friend’s birthday. If we have little money, we can buy a simple and cheap gift. Finally, we must always say ‘Thank you’.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">All of us should have true friends. First, they make us happy. We can also enjoy life more when we have true friends. We can shop with them. Moreover, we can have fun with them. Next, we will always have someone to talk to when we are down. We can share our problems and worries with them.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">In conclusion, our friends are important to us. We must always do our best for our friends.</span></p>'),
(123, 17, 4, '<p style=\"margin-left:0px;\">To get started, here is my real experience in taking English exam in SPM 2014.&nbsp;</p><p style=\"margin-left:0px;\">The 500 words essay I memorised is a ghost story. Below is a summary of it.&nbsp;</p><p style=\"margin-left:0px;\"><strong>A few friends and I challenged each other to visit a haunted hospital. In the hospital, I was chased by a ghost until a dead end. I punched the ghost and the mask fell. It was my friends playing a prank on me.</strong></p><p style=\"margin-left:0px;\">It looks like a short and simple story. But in fact, I have written a lot of things happening in the hospital.</p><p style=\"margin-left:0px;\">For example, dark alley, heavy raining and lightning, mysterious woman crying sounds, bloody doll in the cupboard, white shadow zoomed past me, etc.</p><p style=\"margin-left:0px;\">Below is the question I got in actual exam,</p>'),
(124, 18, 1, '<p style=\"margin-left:0px;\"><span style=\"background-color:transparent;\"><i>Write an email to your friend in </i><strong>about 80 words</strong><i>. Example is below.</i></span></p><p style=\"margin-left:0px;\">&nbsp;</p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">To: </span><a href=\"mailto:zackmanja@gmail.com\"><span style=\"background-color:transparent;\">zackmanja@gmail.com</span></a></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">From: </span><a href=\"mailto:fahmipower@gmail.com\"><span style=\"background-color:transparent;\">fahmipower@gmail.com</span></a></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">Subject: Cooking</span></p><p style=\"margin-left:0px;\">&nbsp;</p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">Hi Zack,</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">You want to cook during school holiday? Great! Sorry, I know your mother is lazy to cook. Therefore, you should learn to cook from your grandmother. She is a good cook. Besides, her foods are awesome!</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">How long? Well, I think you need at least two weeks. Soon, you will be like a chef. Why don’t you learn to cook fried rice first? Then, chicken curry because I know you love it so much. Moreover, it is so simple to cook them.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">Do share with me some photos of your dishes. Bye.</span></p>'),
(125, 18, 2, '<p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">You received an email from your best friend, Ismee, who plans to celebrate his grandfather’s birthday.</span><br>&nbsp;</p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">Hi,</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">Help me please! I need ideas to celebrate my grandfather’s 75th birthday next month. Where shall I have the birthday party? Who should be invited? How can I make his birthday party awesome?</span></p><p style=\"margin-left:0px;\">&nbsp;</p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">Hope to get some ideas from you. Bye!</span></p><p style=\"margin-left:0px;\">&nbsp;</p><p style=\"margin-left:0px;\"><span style=\"background-color:transparent;\"><i>Write an email to your friend in </i><strong>about 80 words</strong><i>. Write your answer according to example below.</i></span></p><p style=\"margin-left:0px;\">&nbsp;</p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">To: izzmee@gmail.com</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">From: jejakaperasanlebih@gmail.com</span></p><p style=\"margin-left:0px;\"><br>&nbsp;</p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">Subject: Awesome Party</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">Hi, Ismee. Wow! Your grandfather will be 75 years old! You should plan a great party for him. Have it at Mantop Café because it has a big room. Furthermore, the food is great!</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">Why don’t you invite your grandfather’s old friends? Of course, family members must be there too. Don’t forget Uncle John, your grandfather’s best friend.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">I think you know all his favourite songs. Maybe all your family members should sing together his most favourite song. I am sure the party will be memorable.</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">Send my love to your grandfather. Bye. [96 words]</span></p><p style=\"margin-left:0px;\"><span style=\"background-color:rgba(0,0,0,0);\">J.P.L</span></p><p style=\"margin-left:0px;\">&nbsp;</p>'),
(126, 19, 1, '<figure class=\"image image_resized\" style=\"width:27.61%;\"><img style=\"aspect-ratio:1800/1012;\" src=\"https://online.anyflip.com/ohuhf/pjou/files/mobile/3.jpg\" alt=\"SPM Writing An Article - Flip eBook Pages 1-12 | AnyFlip\" width=\"1800\" height=\"1012\"></figure><p>According to the example above, write your own essay on topic “<strong>Social Media</strong>”. Good Luck :D</p>'),
