(129, 22, 1, '<p><span style=\"color:rgb(0,0,0);\"><strong>Energy efficiency</strong> refers to the use of less energy to carry out work at the same or higher rate without affecting the production and the quality of the desired outcome.</span></p><p><span style=\"color:rgb(0,0,0);\">Initiatives and efforts carried out in the implementation of energy efficiency:</span></p><ul><li><span style=\"color:rgb(0,0,0);\">The implementation of energy efficiency labels for electrical appliances</span></li><li><span style=\"color:rgb(0,0,0);\">Green Building Index (GBI)</span></li><li><span style=\"color:rgb(0,0,0);\">Energy efficiency technology campaigns</span></li><li><span style=\"color:rgb(0,0,0);\">Using electricity from solar source campaigns</span></li><li><span style=\"color:rgb(0,0,0);\">Consumer awareness campaigns through energy-saving practices</span></li></ul>'),
